// import styled from "styled-components";
import './MediaQueries/Option.css'

const Option = (props) => {
    console.log(props)
  return (
    <div className='optionBox bg-[#f1f1f1] w-[24rem] px-5 py-5 rounded-md cursor-pointer hover:bg-[#e2e1e1]'>
      <div className='optionBoxOne flex items-center space-x-14 max-lg:space-x-20 max-lg:items-center'>
        <div className='optionBoxTxt'>
          <h1 className='leading-5 pb-3 font-medium w-[7rem] text-[17.8px]'>
            {props.data.h1}
          </h1>
          <p className='text-xs w-40'>
            {props.data.p}
          </p>
        </div>
        <div className='optionBoxImg w-28 max-lg:[10rem]'>
        <img src={props.data.img} alt="fhdhfsj"/>
          
        </div>
      </div>
    </div>
  );
};

export default Option;
